padding: 20px;
display: flex;
flex-wrap: wrap;
justify-content: space-between;`
export const AllProduct = ({cat,filters,sort}) => {
    console.log(cat,filters,sort)
    return (
        <Container>
            {AllpopularProducts.map(item=>(
                <Product item={item} key={item.id}/>
            ))}
        </Container>
    )
}
export default AllProduct;
